import { Fragment } from 'react';
import { Link } from 'react-router-dom';
import '../static/css/response.css'

const WrongResponse = () => {
    return (
        <Fragment>
            <center>
                <Link
                    to='/questions/'
                    style={{
                        textDecoration: 'none',
                        color:'red',

                    }}
                >
                    <div className="main-div-response-page-wrong">
                        <h1 className="message"> Oops ..</h1>
                        <p>We are sorry! better luck next time</p>
                        {/* <img src="https://acegif.com/wp-content/gif/confetti-25.gif" style={{width:'50%'}} /> */}
                    </div>
                </Link>
            </center>
        </Fragment>
    )
}

export default WrongResponse;
